Description:
            Teepee and mat is made of 100% cotton. Teepee is formed as an umbrella for a few seconds .The mat is made of 100% cotton fabric, suitable in color and texture to the wigwam. The mat is filled with synthetic padding
Dimensions:
Internal height during installation - approx. 130cm (51inc);
Height folded- 180cm (71inc);
MAT -  43.3in x 43.3in (110cm*110cm)
Equipment:
8 half wooden poles 90cm (35.5inch)
100% cotton teepee tent;
mat - 110cm (43.3in x 43.3in)
1 cord.
Care instructions for teepee:
Machine wash at 30C;
Do not use bleach;
Do not tumble dry;
Do not dry clean.
for mat:
Handwash;
Not pressing;
Do not use bleach;
Do not tumble dry;
Do not dry clean.
We produce only eco-friendly materials!!!
